;; **
;;; Query for inferring PPS posterior.
;; **

;; @@
(def +PRIOR-CONFIDENCE+ 2.)
(def +BANDWIDTH+ 100)

(defn update-beliefs 
  "updates beta beliefs keeping total evidence within the bandwidth"
  [beliefs i j bandwidth]
  (let [beliefs (update-in beliefs [i j] inc)
        [a b] (get beliefs i)]
    (if (> (+ a b) bandwidth)
      (assoc beliefs i [(* bandwidth (/ a (+ a b))) 
                        (* bandwidth (/ b (+ a b)))])
      beliefs)))

(defquery pps [total-page-count pages-per-session-prior data 
               options]
  (declare :primitive update-beliefs)
  (let [bandwidth (sample (exponential (/ 1. (get options :bandwidth +BANDWIDTH+))))
        ; somewhat raw estimate of prior churn probability
        prior-churn-probability (/ 1. pages-per-session-prior)
        ; beta prior
        page-prior [(* +PRIOR-CONFIDENCE+ prior-churn-probability) 
                    (* +PRIOR-CONFIDENCE+ (- 1. prior-churn-probability))]
       
        churn-beliefs (vec (repeat (- total-page-count 1) page-prior))]
    (loop [data data
           churn-beliefs churn-beliefs]
      (if (seq data)
        (let [[pps & data] data
              churn-beliefs 
              (loop [i 0
                     churn-beliefs churn-beliefs]
                (if (= i (- total-page-count 1))
                  ;; reached the end of the campaign
                  churn-beliefs
                  
                  (let [[a b] (nth churn-beliefs i)
                        dist (bernoulli (/ a (+ a b)))]
                    (if (= i (- pps 1))
                      (do
                        ;; churned out
                        (observe dist 1)
                        (update-beliefs churn-beliefs i 0 bandwidth))
                      
                      (do
                        ;; stayed
                        (observe dist 0)
                        (recur 
                          (inc i) 
                          (update-beliefs churn-beliefs i 1 bandwidth)))))))]
          
          (recur data churn-beliefs))

        (do
          ;; save the beliefs, just in case
          (predict :churn-beliefs churn-beliefs)
          (predict :bandwidth bandwidth)
          
          ;; finally, simulate a session;
          ;; hide sampling from inference engine for faster convergence
          (loop [i 0]
            (flush)
            (if (= i (- total-page-count 1)) 
              (+ i 1)
              (let [[a b] (nth churn-beliefs i)
                    p (sample* (beta a b))]
                (if (sample* (flip p)) 
                  (+ i 1) 
                  (recur (inc i)))))))))))
