;; **
;;; Let's simulate some data.
;; **

;; @@
(def +TOTAL-PAGE-COUNT+ 10)
(def +PAGES-PER-SESSION-PRIOR+ 5)
(def +NUMBER-OF-SESSIONS+ 1000)

;; we add some trend to make inference more interesting
(def +DECAY+ 2.)
(def +TREND+ (take +NUMBER-OF-SESSIONS+ (iterate #(* % 
                                                     (exp (- (/ +DECAY+ 
                                                                +NUMBER-OF-SESSIONS+))))
                                                 (float +PAGES-PER-SESSION-PRIOR+))))

(def +DATA+ 
  (map #(max 1 (min +TOTAL-PAGE-COUNT+ 
                             (round (sample* 
                                      (exponential  (/ 1 %))))))
       +TREND+))

(println (print-str (format "Trend from %.4f to %.4f" (first +TREND+) (last +TREND+))))
(println (print-str "Data:" +DATA+))

(println (format "mean: %s" (float (mean +DATA+))))

(plot/histogram +DATA+  :bins +TOTAL-PAGE-COUNT+ :plot-range [[1 (+ +TOTAL-PAGE-COUNT+ 1)] :all])
