(def churn-beliefss (->> posterior-samples
                         (map get-predicts)
                         (map :churn-beliefs)))

(def avg-churn-beliefs
  	 (loop [avg-churn-beliefs (vec (repeat +TOTAL-PAGE-COUNT+ [0. 0.]))
            churn-beliefss churn-beliefss]
       (if (seq churn-beliefss)
         (let [[churn-beliefs & churn-beliefss] churn-beliefss
               avg-churn-beliefs (mapv (fn [[aa ab] [a b]] [(+ aa a) (+ ab b)]) 
                                       avg-churn-beliefs churn-beliefs)]
           (recur avg-churn-beliefs churn-beliefss))
         (map (fn [[a b]] [(/ a N) (/ b N)]) avg-churn-beliefs))))

(def +PREC+ 0.01)
(println (map (fn [[a b]] [(round a) (round b)]) avg-churn-beliefs))
(println (map (fn [[a b]] (* +PREC+ (round (* (/ +PREC+) (/ a (+ a b)))))) avg-churn-beliefs))
