(defn beta-fn [a b]
  (exp (- (+ (log-gamma-fn a) (log-gamma-fn b)) (log-gamma-fn (+ a b)))))
  

(defn pdf [a b]
  (let [Z (beta-fn a b)]
    (println Z)
    (flush)
  	(fn [x] (/ (* (pow x (- a 1)) (pow (- 1 x) (- b 1))) Z))))

